let count = 10, currentCat = 'all';
const wrap = document.getElementById('fonts');
const input = document.getElementById('input');
const size = document.getElementById('size');
const color = document.getElementById('color');

const prefixSelect = document.getElementById('prefixSelect');
const suffixSelect = document.getElementById('suffixSelect');
function applyMap(text, font){
  const map = font.map || {};

  // user selected prefix/suffix
  const prefix = prefixSelect.value || '';
  const suffix = suffixSelect.value || '';
prefixSelect.addEventListener("change", () => {
  const selectedOption =
    prefixSelect.options[prefixSelect.selectedIndex];

  const matchedSuffix =
    selectedOption.getAttribute("data-suffix") || "";

  // suffix auto set
  suffixSelect.innerHTML =
    `<option value="${matchedSuffix}">
      ${matchedSuffix || "Auto"}
     </option>`;

  render();
});

  // ğŸ”¹ STEP 1: mapping FIRST
  const mappedText = text.split('').map(ch=>{
    if(ch === ' ') return ' ';
    const low = ch.toLowerCase();
    return map[low] || ch;
  }).join('');

  // ğŸ”¹ STEP 2: prefix/suffix AFTER
  return prefix + mappedText + suffix;
}
[prefixSelect, suffixSelect].forEach(e =>
  e.addEventListener('change', render)
);


function render() {
  wrap.innerHTML = '';

  const text = input.value.trim() === '' ? 'Fontixa' : input.value;

  fontSets
    .filter(f => currentCat === 'all' || f.cat === currentCat)
    .slice(0, count)
    .forEach(f => {

      const out = f.map
        ? applyMap(text, f)
        : f.text.replace('Fontixa', text);

      const d = document.createElement('div');
      d.className = 'card';

      const fontId = 'font-' + Math.random().toString(36).slice(2, 9);

      d.innerHTML = `
        <div class="font-name">${f.name || 'Stylish Font'}</div>

        <div class="font" id="${fontId}"
             style="font-size:${size.value}px;color:${color.value}">
          ${out}
        </div>

        <div class="actions">
          <button class="btn" onclick="copyText('${fontId}',this)">Copy</button>
        </div>
      `;

      wrap.appendChild(d);
    });
}
function copyText(id, btn) {
  const text = document.getElementById(id).innerText;
  navigator.clipboard.writeText(text);
  btn.textContent = 'Copied';
  setTimeout(() => btn.textContent = 'Copy', 900);
}

function loadMore() { count += 10; render() }
function setCategory(c, b) {
  currentCat = c; count = 10;
  document.querySelectorAll('#categories .btn').forEach(x => x.classList.remove('active'));
  b.classList.add('active'); render();
}
[input, size, color].forEach(e => e.addEventListener('input', render));
render();


// font description js

function openTab(btn, id) {
  document.querySelectorAll('.tab-btn').forEach(b => b.classList.remove('active'));
  btn.classList.add('active');

  btn.scrollIntoView({ behavior: 'smooth', inline: 'center', block: 'nearest' });

  document.querySelectorAll('.desc-box').forEach(d => {
    d.classList.remove('show');
    d.style.display = 'none';
  });

  const box = document.getElementById(id);
  box.style.display = 'block';
  setTimeout(() => box.classList.add('show'), 10);
}

const randomPrefixBtn = document.getElementById("randomPrefixBtn");
randomPrefixBtn.addEventListener("click", () => {

  // saare prefix options
  const options = [...prefixSelect.options]
    .filter(opt => opt.value !== ""); // No Prefix hata do

  if (!options.length) return;

  // random option pick
  const randomOption =
    options[Math.floor(Math.random() * options.length)];

  // prefix select karo
  prefixSelect.value = randomOption.value;

  // matching suffix auto set
  const matchedSuffix =
    randomOption.getAttribute("data-suffix") || "";

  suffixSelect.innerHTML =
    `<option value="${matchedSuffix}">
      ${matchedSuffix || "Auto"}
     </option>`;

  render();
});



